import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header/header.js';
import './components/Header/header.css';
import './components/MainPart/main_part.css';
import PhotosPart from './components/PhotosPart/photos_part';
import './components/PhotosPart/photos_part.css';
import Bottom from './components/Bottom/bottom';
import './components/Bottom/bottom.css';
import Footer from './components/Footer/footer';
import './components/Footer/footer.css';
import MainPart from "./components/MainPart/main_part";

function App() {
    return (

    <BrowserRouter>
        <Routes>
            <div>
            <Header/>
            <Footer />
        </div>
            <Route path="/" element={<Home/>} />
            <Route path="/about" element={<Catalog />} />
            <Route path="/contact" element={<Cart />} />
        </Routes>
    </BrowserRouter>
    );
}

function Home() {
    return <h2>Home</h2>;
        return (
            <div>
                <h2>Home</h2>
                <MainPart />
                <PhotosPart />
                <Bottom />
            </div>
        );

}

function Catalog() {
    return <h2>Catalog</h2>;
}

function Cart() {
    return <h2>Cart</h2>;
}

export default App;
